description:
Verenigde Staten
Actie / Thriller
103 minuten

goed

met Jet Li, Jason Statham en Devon Aoki

Wanneer de collega van FBI-agent Jack Crawford wordt vermoord door de mysterieuze huurmoordenaar 'Rogue' zweert deze wraak te 
nemen. Wat volgt is een intensieve klopjacht op 'Rogue', die bovendien een dodelijke oorlog heeft ontketend tussen twee 
Aziatische misdaadsyndicaten.
